import React from 'react'
import './CSS/style.css'
import { Link } from 'react-router-dom';
import { FaHome} from 'react-icons/fa';

const Nav = () => {
  return (
    <>
    <div className="navBar">
        <FaHome/>
        <Link to="/" className='Home'>Home</Link>
    </div>
    </>
  )
}

export default Nav
